import React from "react";
import { Scatter } from "react-chartjs-2";
import { Chart, PointElement, LineElement, CategoryScale, LinearScale } from "chart.js";

Chart.register(PointElement, LineElement, CategoryScale, LinearScale);

export default function VIGraph({ data }) {
  const chartData = {
    datasets: [
      {
        label: "VI Characteristics",
        data: data.map(row => ({ x: row.voltage, y: row.current })),
        showLine: true,
        borderWidth: 2,
        pointRadius: 0,
        tension: 0.3
      }
    ]
  };

  const options = {
    scales: {
      x: {
        title: { display: true, text: "Voltage (V)" },
        min: Math.min(...data.map(d => d.voltage)),
        max: Math.max(...data.map(d => d.voltage)),
        grid: { color: "rgba(180,180,180,0.4)" }
      },
      y: {
        title: { display: true, text: "Current (A)" },
        min: Math.min(...data.map(d => d.current)),
        max: Math.max(...data.map(d => d.current)),
        grid: { color: "rgba(180,180,180,0.4)" }
      }
    }
  };

  return <Scatter data={chartData} options={options} />;
}
